  methods: {
    wrapData (rawData, categories, types) {
      const data = rawData.map((data, index) => {
        const [category, typename, start, end] = data
        const typeItem = types.filter((element) => {
          if (element.name === typename) return true
        })
        return {
          name: typeItem[0].name,
          value: [categories.indexOf(category), start, end, end - start],
          itemStyle: {
            color: typeItem[0].color
          }
        }
      })
      return data
    },
    renderItem (params, api) {
      let categoryIndex = api.value(0)
      let start = api.coord([api.value(1), categoryIndex])
      let end = api.coord([api.value(2), categoryIndex])
      let height = api.size([0, 1])[1] * 0.6
      let rectShape = echarts.graphic.clipRectByRect(
        {
          x: start[0],
          y: start[1] - height / 2,
          width: end[0] - start[0],
          height: height
        },
        {
          x: params.coordSys.x,
          y: params.coordSys.y,
          width: params.coordSys.width,
          height: params.coordSys.height
        }
      )
      return (
        rectShape && {
          type: 'rect',
          transition: ['shape'],
          shape: rectShape,
          style: api.style()
        }
      )
    },
    initChart () {
      const startIndex = this.startIndex
      const myChart = echarts.init(document.getElementById('chart-container'))
      const option = {
        tooltip: {
          formatter: function (params) {
            return params.marker + params.name + ': ' + params.value[1] + ' - ' + params.value[2]
          }
        },
        title: {
          text: this.title,
          left: 'center'
        },
        dataZoom: [
          {
            type: 'slider',
            filterMode: 'weakFilter',
            showDataShadow: false,
            labelFormatter: ''
          },
          {
            type: 'slider',
            filterMode: 'weakFilter',
            yAxisIndex: 0,
            showDataShadow: false,
            labelFormatter: ''
          }
        ],
        grid: {
          // height: 700
        },
        xAxis: {
          min: startIndex,
          scale: true,
          axisLabel: {
            formatter: function (val) {
              return Math.max(0, val - startIndex)
            }
          }
        },
        yAxis: {
          data: this.categories
        },
        series: [
          {
            type: 'custom',
            renderItem: this.renderItem,
            itemStyle: {
              opacity: 0.8
            },
            encode: {
              x: [1, 2],
              y: 0
            },
            data: this.data
          }
        ]
      }
      option && myChart.setOption(option)
    }
  }
